import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";

const Newsletter = () => {
  return (
    <div className="relative flex flex-col min-h-screen bg-gradient-to-b from-gray-800 to-black text-white">
      {/* Navbar */}
      <Navbar />

      {/* Main Content */}
      <div className="flex-grow flex flex-col items-center justify-center text-center px-6">
        <h1 className="text-6xl font-extrabold tracking-wide mb-4">
          STAY TUNED
        </h1>
        <div className="w-24 h-1 bg-blue-500 mb-6"></div>
        <p className="text-lg text-gray-300 max-w-xl leading-relaxed">
          We’re working on something exciting. Be the first to know—stay tuned
          for updates!
        </p>
        <button className="mt-8 bg-blue-600 hover:bg-blue-700 text-white font-semibold py-3 px-8 rounded-lg shadow-lg transition duration-300">
          Learn More
        </button>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default Newsletter;
